SELECT DISTINCT ?program WHERE {
  ?program a <http://dbpedia.org/ontology/FrequentFlyerProgram> ;
           <http://dbpedia.org/ontology/airline> ?airline }
GROUP BY ?program
ORDER BY DESC(count(?airline)) OFFSET 0 LIMIT 1

SELECT DISTINCT ?country
WHERE { 
  ?place <http://dbpedia.org/ontology/cave> ?cave ;
         <http://dbpedia.org/ontology/isPartOf> ?country .
  {
    SELECT ?place
    WHERE { 
      ?place <http://dbpedia.org/ontology/cave> ?cave 
    }
    GROUP BY ?place
    HAVING (COUNT(?cave) > 2)
  }
}

SELECT DISTINCT ?uri WHERE { 
  ?uri a <http://dbpedia.org/ontology/Country> . 
  { SELECT ?uri WHERE { ?volcano a <http://dbpedia.org/ontology/Volcano> ; <http://dbpedia.org/ontology/country> ?uri } GROUP BY ?uri HAVING(COUNT(?volcano) > 10) } 
}

SELECT DISTINCT ?uri WHERE { 
  ?uri <http://dbpedia.org/ontology/orderInOffice> ?order ;
       <http://dbpedia.org/ontology/nationality> <http://dbpedia.org/resource/United_States> ; 
       <http://dbpedia.org/ontology/termPeriod> ?termPeriod .
  ?termPeriod <http://dbpedia.org/ontology/start> ?start ;
              <http://dbpedia.org/ontology/end> ?end .
  FILTER((?end >= "2002-01-01"^^xsd:date) && (?start <= "2022-01-01"^^xsd:date))
} ORDER BY DESC(?start)

SELECT DISTINCT ?height WHERE {  
  ?player a <http://dbpedia.org/ontology/BasketballPlayer> ;
           <http://dbpedia.org/ontology/height> ?height ;
           <http://dbpedia.org/property/team> ?team .
  ?team a <http://dbpedia.org/ontology/BasketballTeam> .
  FILTER EXISTS { ?player <http://dbpedia.org/ontology/activeYears> ?years }
} ORDER BY ASC(?height) LIMIT 1

SELECT DISTINCT ?player WHERE { 
  ?player a <http://dbpedia.org/ontology/SoccerPlayer> ; 
           <http://dbpedia.org/property/youthyears> ?age ;
           <http://dbpedia.org/ontology/team> <http://dbpedia.org/resource/Premier_League> 
} ORDER BY ASC(?age) LIMIT 1

PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>
SELECT (COUNT(DISTINCT ?river) AS ?rivers) (COUNT(DISTINCT ?lake) AS ?lakes)
WHERE {
    {
        SELECT DISTINCT ?river WHERE {
            ?river dbo:isPartOf dbr:South_Carolina ;
            a dbo:River .
        }
    }
    UNION
    {
        SELECT DISTINCT ?lake WHERE {
            ?lake dbo:isPartOf dbr:South_Carolina ;
            a dbo:Lake .
        }
    }
}

SELECT DISTINCT ?trail WHERE { 
  ?trail a <http://dbpedia.org/ontology/HikingTrail> ; 
          <http://dbpedia.org/property/location> <http://dbpedia.org/resource/Grand_Canyon> ;
          <http://dbpedia.org/property/danger> ?danger .
  FILTER NOT EXISTS { 
    ?trail <http://dbpedia.org/ontology/danger> ?danger .
    FILTER (regex(?danger, "Flash flood", "i")) 
  } 
}
